import React, { useState } from 'react';

import './styles.css';

const UserItem = ({ user }) => {
  const [admin, setAdmin] = useState('');
  if (user.Admin === 1) {
    setAdmin('Administrador');
  } else {
    setAdmin('Não é dministrador');
  }
  return (
    <article className="workstation-item">
      <header>
        <div>
          <strong>Nome: {user.name}</strong>
        </div>
      </header>
      <h2>Data de Nascimento: {user.data_nascimento}</h2>
      <h2>Endereço: {user.endereco_pessoal}</h2>
      <h2>Admin: {user.isAdmin}</h2>
      <h1>Biografia: {user.biografia}</h1>

      <button>Tornar Admin</button>
    </article>
  );
};

export default UserItem;
